/** @format */
import React from "react";

export default function Page({ countryPerPage, paginated, allCountry }) {
   const pageNumber = [];
   for (let i = 1; i <= Math.ceil(allCountry / countryPerPage); i++) {
      pageNumber.push(i);
   }
   return (
      <div>
         {pageNumber &&
            pageNumber.map((e) => (
               <button key={e}>
                  <button>
                     <button onClick={() => paginated(e)}>{e}</button>
                  </button>
               </button>
            ))}
      </div>
   );
}
